INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20801, 33456, 'Quetiapine', 'Liver Diseases', 'Most neuroleptic agents are extensively metabolized by the liver.  The plasma concentrations of these agents may be increased and the half-lives prolonged in patients with impaired hepatic function.  Therapy with neuroleptic agents should be administered cautiously in patients with significant liver disease.  Lower initial dosages and slower titration may be appropriate.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20802, 33457, 'Quetiapine', 'Liver Diseases', 'Most neuroleptic agents are extensively metabolized by the liver.  The plasma concentrations of these agents may be increased and the half-lives prolonged in patients with impaired hepatic function.  Therapy with neuroleptic agents should be administered cautiously in patients with significant liver disease.  Lower initial dosages and slower titration may be appropriate.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20803, 1191, 'Quetiapine', 'Parkinsonian Disorders', 'The use of neuroleptic agents is associated with pseudo-parkinsonian symptoms such as akinesia, bradykinesia, tremors, pill-rolling motion, cogwheel rigidity, and postural abnormalities including stooped posture and shuffling gait.  The onset is usually 1 to 2 weeks following initiation of therapy or an increase in dosage.  Older neuroleptic agents such as haloperidol are more likely to induce these effects, and their use may be contraindicated in patients with Parkinson''s disease or parkinsonian symptoms.', '2', '', 'DDInter', 0);
